import React from 'react'
import MenuIcon from '@material-ui/icons/Menu';
import SearchIcon from '@material-ui/icons/Search';


function Header() {
    return (
        <div className="header">
            <h1> I am a header</h1>
            <MenuIcon />
            <img
            clasName="header_logo"
            src="https://upload.wikimedia.org/wikipedia/commons/thumb/9/98/YouTube_Logo.svg/512px-YouTube_Logo.svg.png" alt=""></img>

    <input type="text"></input>
        <SearchIcon/>

</div>
    )
}

export default Header
